import React from 'react';
import { Link } from 'react-router-dom';
import './HomePage.css'; // Importe o arquivo CSS para estilização

const HomePage = () => {
  return (
    <div className="home-container">
      <h1>Voce precisa </h1>
      <div className="button-container">
        <Link to="/novo-cliente">
          <button className="home-button">Cadastro de Clientes</button>
        </Link>
        <Link to="/inicio">
          <button className="home-button">Login e Registro de Barbeiro</button>
        </Link>
      </div>
    </div>
  );
};

export default HomePage;
